const WeatherCard = props => {

  const weatherForecast = props.weatherForecast;

  const dailyCard = weatherForecast.map((index) => {
    return (
      <div className="ui card" id="card">
        <div className="image">
          <img src={index.day.condition.icon} alt="Weather Icon" />
        </div>
        <div className="content">
          {index.date}
          Current Conditions: {index.day.condition.text}

          <div className="meta">
            <p className="header">
              <span>High/Low:
                {index.day.maxtemp_f} / {index.day.mintemp_f}
              </span>
            </p>

          </div>
          <div className="description">

          </div>
        </div>
      </div>
    )
  })

  return(
    <div>
      {dailyCard}
    </div>
  )
}

export default WeatherCard;
